import { FC } from 'react';
import './App.css';
import Footer from '../components/Footer/Footer';
import Header from '../components/Header/Header';
import Main from '../components/Main/Main';
import Cards from '../components/Cards/Cards';

const App: FC = () => (
  <div className="App">
    <Header />
    <Cards />
    <Main />
    <Footer />
  </div>
);

export default App;
